import React from 'react';
import Detail from './component/DetailPokemon/DetailPokemon';
import './app.css'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Login from './component/Login/Login';
import ShowPokemon from './component/ShowPokemon/ShowPokemon';
import Header from './component/Layouts/HomeLayout';
function App() {
  return (
    <Router>
    <Header></Header>
    <Switch>
        <Route
            path='/pokemon/:id'
            exact
            render={props => 
              <Detail {...props}/>
            }
          />
        <Route
            path='/ability/:id'
            exact
            render={props => 
              <Detail {...props}/>
            }
          />
        <Route path='/' exact >
          <ShowPokemon/>
        </Route>
        <Route path='/login' exact>
          <Login/>
        </Route>
      </Switch>
    </Router>
  )
}

export default App;
